import React, { Component } from 'react';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import $ from 'jquery';
import Logout from '../Components/Logout';
import {Redirect,withRouter} from 'react-router-dom';
import './Styles/Login.css';
Window.$ = $;

class Profile extends Component {
	constructor(props){
		super(props);

		this.handleLogout = this.handleLogout.bind(this);
	}
	
	handleLogout(event){
		event.preventDefault();
		this.props.logout(this.state.username,this.state.password);
	}
	
render() {
		if(this.props.User.username!==undefined){
			return(
				<div style={{position:"absolute",top:0,left:0,right:0,bottom:0,width:"100%",height:"100%"}}>
					<nav className="navbar navbar-expand-lg navbar-dark bg-dark fixed-top" role="navigation">
						<div className="container">
							<a className="navbar-brand" href="#">CloudDrive</a>
							<button className="navbar-toggler border-0" type="button" data-toggle="collapse" data-target="#exCollapsingNavbar">
								&#9776;
							</button>
							<div className="collapse navbar-collapse" id="exCollapsingNavbar">
								<ul className="nav navbar-nav">
									<li className="nav-item"><a href="#" className="nav-link">About</a></li>
									<li className="nav-item"><a href="#" className="nav-link">Link</a></li>
									<li className="nav-item"><a href="#" className="nav-link">Service</a></li>
									<li className="nav-item"><a href="#" className="nav-link">More</a></li>
								</ul>
								<ul className="nav navbar-nav navbar-right flex-row justify-content-between ml-auto">
									<button type="button" id="dropdownMenu1" data-toggle="dropdown" class="btn btn-primary" style={{border:0, position:"relative",right:"-2950%", borderRadius:"0px", backgroundColor:"transparent"}} title="settings"><i className="fa fa-cog fa-fw fa-lg"></i> <span class="caret"></span></button>
										<ul className="dropdown-menu dropdown-menu-right mt-2">
											<li className="px-3 py-2">
												<form className="form">
													<div className="form-group">
														<Logout/>
													</div>
												</form>
											</li>
										</ul>
								</ul>
							</div>
						</div>
					</nav>
				</div>
			);
		}else{
			return(<Redirect to="/" />);
		}
	}
}

Profile.propTypes = {
	logout: PropTypes.func.isRequired,
	User: PropTypes.object,
}

const mapStateToProps = (state) => ({
	User: state.Users.User,
	LoggedIn: state.Users.LoggedIn
})

export default withRouter(connect(mapStateToProps, null)(Profile));
